// rfc
import React from "react";

export default function SignUp() {
  return (
    <div
      className="SignUp"
      style={{
        backgroundImage: "url(" + "https://tsks.app/img/signin_balls.png" + ")",
      }}
    >
        <h1 className="caption">Sign Up</h1>
        <button className="button btn-border">
            <span className="button__"></span>
        </button>
        <button className="button btn-border">
            <span className="button__"></span>
        </button>
    </div>
  );
}
